  render() {
    const { name, email, gender, phone, image } = this.context.state.loggedUser
    return (
      <div>
        <Modal
          title="Edit Profile"
          visible={this.props.visible}
          onOk={this.props.handleOk}
          onCancel={this.props.handleCancel}
        >
          <Form>
            <Form.Item label="User name">
              <Input></Input>
            </Form.Item>
            <Form.Item label="Email">
              <Input></Input>
            </Form.Item>
            <Form.Item label="Gender">
              <Input></Input>
            </Form.Item>
            <Form.Item label="Phone">
              <Input></Input>
            </Form.Item>
          </Form>
        </Modal>
      </div>
    )
  }
}

